import CssBaseline from '@mui/material/CssBaseline';
import Box from '@mui/material/Box';
import Container from '@mui/material/Container';
import * as React from 'react';
import { useState } from 'react';

//import FormInputs from './component/FormInputs';
import {
Select,
  Button,
  TextField,
 FormControl,

  InputLabel,
  MenuItem

} from "@mui/material";
//import { textAlign } from '@mui/system';

function App() {

  const [inputField, setInputField] = useState({
    interestType: '',
    bankName:'',
    outstandingAmount:''
  });

  const intrestTypeHandler = (e)=>{
    setInputField({...inputField, interestType : e.target.value})
  }

  const BankNameHandler = (e)=>{
    setInputField({...inputField, bankName : e.target.value})
  }

  const AmountHandler = (e)=>{
    setInputField({...inputField, outstandingAmount : e.target.value})
  }

  const submitButton = (e)=>{
    console.log(inputField.interestType)
    console.log(inputField.bankName)

    console.log(inputField.interestTyp)

  }


  return (<>


<React.Fragment>
      <CssBaseline />

      <Container maxWidth="md">
        <Box sx={{
          display: "flex",
          marginTop: 5,
          boxShadow: 5,
          borderRadius: 2,
          width: 800,
          justifyContent: "center",
          marginBottom :5,
          fontfamily: 'Poppins',
            fontweight: 400,

        }}>
         <FormControl>


         <FormControl sx={{
              m: 1,
             minWidth: 300,
             fontfamily: 'Poppins',
            fontweight: 400,
           fontsize: 48,
          lineheight: 28

          }}>
          <div><h3>Loan Details</h3>

          </div>
          </FormControl>
          <div>

      <FormControl sx={{ m: 2, minWidth: 300 }}>
        <InputLabel id="simple-select-autowidth-label" name="bankName">Bank Name</InputLabel>
        <Select
          // labelId="demo-simple-select-autowidth-label"
          // id="simple-select-autowidth"

          onChange={BankNameHandler}
          value ={inputField.bankName}
          label="BankName"
        >
          <MenuItem value="">
            <em>None</em>
          </MenuItem>
          <MenuItem value={1}>Bank One</MenuItem>
          <MenuItem value={2}>Bank Two</MenuItem>
          <MenuItem value={3}>Bank Three</MenuItem>
        </Select>
      </FormControl>
    </div>

    <FormControl sx={{ m: 2, minWidth: 300 }}>
      <TextField type="number" 
      id="outlined-basic"
       label="Outstanding Amount"
       variant="outlined"
       name='outstandingAmount'
       onClick={AmountHandler}
       />
      </FormControl>

      <FormControl sx={{ m: 2, minWidth: 300 }}>
      <TextField type="number" id="outlined-basic" label="Interest Rate " variant="outlined" />
      </FormControl>


     <FormControl sx={{ m: 2, minWidth: 300 }}>
      <TextField id="outlined-basic"
       label="Interest Type"
        name= "interestType"
         variant="outlined"
         onChange={intrestTypeHandler}
         value ={inputField.interestType}
          />
      </FormControl>

      <FormControl sx={{ m: 2, minWidth: 300 }}>
      <TextField 
      type="number" 
      id="outlined-basic" 
      label="Loan Type"
       variant="outlined"
        />
      </FormControl>

      <FormControl sx={{ m: 2, minWidth: 300 }}>
        <TextField id="outlined-basic" label="Term" variant="outlined" />
      </FormControl>


      <FormControl sx={{ m: 2, minWidth: 300 }}>
      <TextField id="outlined-basic" label="Properties" variant="outlined" />
      </FormControl>

      <FormControl sx={{ m: 2, minWidth: 300 }}>
      <TextField id="outlined-basic" label="Additional Securities" variant="outlined" />
      </FormControl>

      <FormControl sx={{ m: 2, minWidth: 300 }}>
      <TextField id="outlined-basic" label="is Coborrowed ?" variant="outlined" />
      </FormControl>


      <Button variant="contained" onClick={submitButton}>SAVE</Button>;
      </FormControl>
      </Box>
      </Container>

    </React.Fragment>
    <div className="App">








    </div>
    </>
  );
}

export default App;
